0','2020-10-30 23:59:59'),(84,1,'Veřejná vyhláška - místní úprava provozu na silnici I/33 při obci Černožice',NULL,11,4,'2020-10-14 00:00:00','2020-10-30 23:59:59'),(85,1,'Hejtman Královéhradeckého kraje určuje tyto školy a školská zařízení na území KHK,',NULL,19,4,'2020-10-16 00:00:00',NULL),(86,1,'Nabídka nábytku','<p>Pedagogicko-psychologická poradna a Speciálně pedagogické centrum Královéhradeckého kraje nabízí nepotřebný majetek z PPP a SPC Jičín a Rychnov nad Kněžnou.\n</p><p>\n</p><p>Případní zájemci mne mohou kontaktovat na mail: b.fikarova@pppkhk.cz nebo na tel. čísle <strong>606 729 322 do 30. 9. 2020.</strong>\n</p><p>\n</p><p>S pozdravem\n</p><p>\n</p><p>Blanka Fikarová - účetní</p>',20,5,'2020-09-21 08:55:12',NULL),(87,1,'Nabídka židlí','<p>Školní jídelna Hradec Králové, Hradecká 1219, nabízí &nbsp;k bezúplatnému převodu organizacím zřizované Královehradeckým krajem, tento přebytečný majetek:</p><p><strong>Židle dřevěná hnědá - ohýbaná překližka třešeň</strong></p><p>Rok pořízení 2010, dřevěná hnědá, kovový rám šedý-nástřik, nabízíme 200 kusů</p><p>stav: používané, funkční, nepatrně poškrábané</p><p>V případě zájmu uplatněte svůj požadavek na e-mailové adrese <a href=\"mailto:info@jidelnahradecka.cz\">info@jidelnahradecka.cz</a> či na telefonu 602 500 052 nejpozději <strong>do 30.8.2020.</strong></p><p>Děkuji</p><p>Martin Svátek<br />\nředitel</p><p>Školní jídelna,<br />\nHradecká 1219,<br />\n500 03 Hradec Králové<br />\ntel.: 495 511 064, 602 500 052<br />\n<a href=\"mailto:info@jidelnahradecka.cz\">info@jidelnahradecka.cz</a></p>',21,5,'2020-06-12 11:51:06',NULL),(88,1,'Nabídka výstavního systému Kupka','<p>Nabídka výstavního systému &bdquo;Kupka&ldquo; &ndash; jedná se o dva výstavní systémy: interiérový a exteriérový, kdy výstavní systémy obsahuje celkem 22 oboustranných, samostatně stojících výstavních panelů: 18 interiérových a 4 exteriérové. Každá panelová deska výstavního panelu obsahující informace o životě a díle malíře Františka Kupky je z jedné strany opatřena česko-francouzskou mutací a z druhé strany anglicko-německou mutací. Na použití výstavního systému se vztahovala autorská práva, která byla časově omezená a jejichž platnost již skončila.\n</p><p>\n</p><p>Případní zájemci o výstavní systém prosím pište na e-mail <a href=\"mailto:lrovenska@kr-kralovehradecky.cz\">lrovenska@kr-kralovehradecky.cz</a> <strong>do 30. 10. 2020.</strong></p>',22,5,'2020-10-14 16:21:44','2020-10-30 23:59:59'),(89,1,'Oznámení o vyhlášení výběrového řízení na místo: právník/právnička odboru územního a stavebního řádu',NULL,23,6,'2020-10-06 00:00:00','2020-11-13 23:59:59'),(90,1,'Oznámení o vyhlášení výběrového řízení na místo: odborný/á referent/ka oddělení stavebního řádu, odbor ÚP a SŘ, doba určitá',NULL,23,6,'2020-10-06 00:00:00','2020-11-06 23:59:59'),(91,1,'Oznámení o vyhlášení výběrového řízení na místo: odborný/á referent/ka oddělení stavebního řádu, odbor ÚP a SŘ',NULL,23,6,'2020-10-06 00:00:00','2020-10-30 23:59:59'),(92,1,'Oznámení o vyhlášení výběrového řízení na místo: referent/ka oddělení příprav a realizace staveb, odbor investic',NULL,23,6,'2020-10-06 00:00:00','2020-11-18 23:59:59'),(93,1,'Rozhodnutí o zrušení výběrového řízení: referent/ka oddělení regionálního rozvoje',NULL,23,6,'2020-10-21 00:00:00','2020-10-30 23:59:59'),(94,1,'Nemocnice Náchod přijme klinického logopeda/logopeda v předatestační přípravě do Náchoda','<p><strong>Nemocnice Náchod přijme </strong>\n</p><p>\n</p><p><h2>klinického logopeda/logopeda v předatestační přípravě</h2>\n</p><p>\n</p><p><strong>do Náchoda</strong><ul><li><strong>Pracoviště: </strong>Oblastní nemocnice Náchod a.s.</li><li><strong>Úvazek: </strong>1,0 popř. dle dohody</li><li><strong>Provoz:</strong> jednosměnný</li><li><strong>Datum nástupu: </strong>ihned nebo dle dohody/ zástup za mateřskou a rodičovskou dovolenou</li></ul>\n</p><p>\n</p><p><h3>CO U NÁS BUDETE DĚLAT:</h3>\n</p><p>\n</p><p>Nabízíme práci se širokým spektrem diagnóz dospělého věku (afázie, dysartrie, dysfagie atd.). Jedná se o práci zejména na oddělení neurologie JIP, neurologie, rehabilitace.\n</p><p>\n</p><p><h3>CO NA VÁS ČEKÁ:</h3>\n</p><p>\n</p><p><ul><li>Zázemí druhé největší nemocnice v Královéhradeckém kraji</li><li>Pestrá práce v přátelském týmu</li><li>Možnost osobního i profesního růstu a podpora dalšího vzdělání</li><li>Stabilní platové ohodnocení dle platových tabulek</li><li>5 týdnů dovolené</li><li>Pomoc se zajištěním ubytování</li><li>Příspěvek na stravování a strava v závodní jídelně v areálu nemocnice</li><li>A další zaměstnanecké benefity</li></ul>\n</p><p>\n</p><p><h3>KOHO HLEDÁME?</h3>\n</p><p>\n</p><p><ul><li>Máte atestaci z klinické logopedie nebo jste v přípravě na ni?</li><li>Máte zájem o další vzdělávání v oboru?</li><li>Aktivní přístup k práci a zodpovědnost Vám není cizí?</li><li>Jste schopný/á pracovat samostatně i v týmu?</li><li>Máte chuť učit se nové věci a jste flexibilní?</li></ul>\n</p><p>\n</p><p><h3>CO VYŽADUJEME:</h3>\n</p><p>\n</p><p>Trestní bezúhonnost\n</p><p>\n</p><p><h3>NEVÁHEJTE SE OZVAT A POJĎTE DO TOHO! @</h3>\n</p><p>\n</p><p>V případě zájmu/dotazů kontaktujte:\n</p><p>\n</p><p>Mgr. Holub Lukáš, vedoucí útvaru personálního řízení a mezd,<br />e-mail: <a href=\"mailto:holub.lukas@nemocnicenachod.cz\">holub.lukas@nemocnicenachod.cz</a> , tel.: 737 271 012</p>',24,7,'2020-06-09 14:19:08','2020-12-31 23:59:59'),(95,1,'Nemocnice Náchod přijme lékaře i absolventa do Endoskopického centra','<p>Nemocnice Náchod přijme</p><h2>lékaře i absolventa do Endoskopického centra v Náchodě</h2><h3>Požadujeme:</h3><ul><li>odbornou způsobilost k výkonu povolání lékaře</li><li>certifikát o základním kmeni výhodou</li><li>specializovaná způsobilost v příslušném oboru výhodou</li><li>trestní bezúhonnost</li></ul><h3>Nabízíme:</h3><ul><li><strong>nástup možný ihned</strong></li><li>pracovní poměr na dobu neurčitou</li><li><strong>akreditované pracoviště II. typu s možností získání veškerých funkčních licencí pro obor gastroenterologie</strong></li><li>zvyšování a prohlubování kvalifikace</li><li>možnost využití nemocniční knihovny</li><li>pomoc se zajištěním ubytování</li><li>poskytujeme příspěvek na ubytování (pro nově přijímané zaměstnance s trvalým bydlištěm mimo Královéhradecký kraj) ve výši 3 500 Kč měsíčně po dobu 24 měsíců</li><li>umožňujeme rychlý odborný růst v rámci naší nemocnice a ve spolupráci se smluvními zařízeními</li><li>dotovaná strava v jídelně v areálu nemocnice</li><li>příspěvek na penzijní a životní pojištění až 7 200 Kč ročně</li><li>úhrada členského příspěvku České lékařské komoře při úvazku 0,5</li><li>nástupní mzda lékaře bez praxe od 35 540 Kč</li><li>nástupní mzda lékaře po základním kmeni od 42 560 Kč</li><li>nástupní mzda lékaře se specializací od 51 560 Kč</li><li>poskytujeme stabilizační odměnu až 60 000 Kč při setrvání v pracovním poměru minimálně 18 měsíců při úvazku 1,0</li><li><strong>veškeré platové podmínky vč. výše stabilizační odměny budou upřesněny při osobním pohovoru</strong></li></ul><p>V případě zájmu a dalších dotazů neváhejte kontaktovat: MUDr. Zdeněk Papík, Ph.D. &ndash; primář<br />\ntel.: 731 834 309; e-mail: <a href=\"mailto:papik.zdenek@nemocnicenachod.cz\">papik.zdenek@nemocnicenachod.cz</a></p>',24,7,'2020-06-10 09:43:49','2020-12-31 23:59:59'),(96,1,'Oblastní nemocnice Náchod a.s. přijme lékaře/lékařku absolventa na gynekologicko-porodnické oddělení do nemocnice Náchod','<p>Oblastní nemocnice Náchod přijme lékaře/lékařku absolventa na gynekologicko-porodnické oddělení do nemocnice Náchod\n</p><p>\n</p><p><strong>Požadujeme:</strong><ul><li>odbornou způsobilost k výkonu povolání lékaře</li></ul><strong>Nabízíme:</strong><ul><li>poskytujeme <strong>stabilizační odměnu 25 000 Kč </strong>při setrvání v pracovním poměru minimálně 18 měsíců při úvazku 1,0, <strong>80 000 Kč</strong> při setrvání v pracovním poměru minimálně 60 měsíců při úvazku 1,0 (vyplácena po 3M zkušební době jako záloha)</li><li><strong>nástupní mzda pro lékaře bez praxe od 33 540 