ště MR</h3>\n</p><p>\n</p><p><strong>Požadujeme:</strong><ul><li>&bull; vzdělání dle &sect; 8 zákona č. 96/2004 Sb., o nelékařských zdravotnických povoláních</li><li>&bull; požadujeme praxi na magnetické rezonanci nebo minimálně zkušenost v rámci odborné praxe při studiu</li><li>&bull; trestní bezúhonnost</li><li>&bull; zdravotní způsobilost</li></ul><strong>Nabízíme:</strong><ul><li>&bull; pracovní poměr na dobu neurčitou</li><li>&bull; nástupní mzdu od 26 590 Kč (platové podmínky budou upřesněny při osobním jednání)</li><li>&bull; nástup možný ihned</li><li>&bull; možné i pro absolventa</li><li>&bull; zaměstnanecké benefity</li><li>&bull; dotovaná strava v areálu nemocnice</li><li>&bull; pomoc při zajištění ubytování</li><li>&bull; jednosměnný provoz, po zapracování možnost zařazení do služeb</li><li>&bull; stabilizační odměnu 20 000 Kč při setrvání v pracovním poměru 18 měsíců při úvazku 1,0</li><li>&bull; příspěvek na ubytování (trvalé bydliště mimo Královéhradecký kraj)</li></ul>Radiologický asistent provádí radiologické zobrazovací i kvantitativní postupy, léčebné aplikace ionizujícího záření a poskytuje specifickou ošetřovatelskou péči v souvislosti s radiologickými výkony. Zajišťuje radiační ochranu, a ve spolupráci s lékařem se podílí na diagnostické a léčebné péči.\n</p><p>\n</p><p>V případě zájmu kontaktujte:\n</p><p>\n</p><p>Bc. Eva Jará, tel. 728 215 931, e-mail: <a href=\"mailto:jara.eva@nemocnicenachod.cz\">jara.eva@nemocnicenachod.cz</a></p>',25,7,'2020-07-30 10:20:34','2020-12-31 23:59:59'),(104,1,'Oblastní nemocnice Náchod přijme lékaře/ku pro nově vybudované pracoviště magnetické rezonance radiologického oddělení','<p><h3>Požadujeme:</h3>\n</p><p>\n</p><p><ul><li>- specializovanou způsobilost v oboru</li><li>- praxe a plná erudice v MR diagnostice</li><li>- trestní bezúhonnost</li></ul>\n</p><p>\n</p><p><h3>Nabízíme:</h3>\n</p><p>\n</p><p><ul><li>- nástup možný ihned/ dle dohody</li><li>- pracovní poměr na dobu neurčitou</li><li>- plný / popř. zkrácený pracovní úvazek</li><li>- zaměstnanecké benefity</li><li>- 5 týdnů dovolené</li><li>- vysoce nadstandartní platové ohodnocení</li><li>- stabilizační odměna 60.000, -Kč při úvazku 1,0 a setrvání v pracovním poměru minimálně 18 měsíců</li></ul>\n</p><p>\n</p><p><h3>Co můžete očekávat:</h3>\n</p><p>\n</p><p><ul><li>- práci na moderně vybaveném akreditovaném pracovišti &ndash; v krátkém výhledu ve zcela nově vybudovaném pavilonu v prostředí česko-kladského pomezí</li><li>- plně digitalizovaný RTG provoz; MDCT; MR; 1,5 T; UZV; RTG, mamoscreening</li><li>- teleradiologie</li><li>- profesní růst</li></ul>\n</p><p>\n</p><p><h3>V případě zájmu kontaktujte:</h3>\n</p><p>\n</p><p>MUDr. Marka Strnada, primáře RTG oddělení, e-mail: <a href=\"mailto:strnad.marek@nemocnicenachod.cz\">strnad.marek@nemocnicenachod.cz</a> , tel.: 606 071 925<br />popř. MUDr. Petr Škoda, e-mail: <a href=\"mailto:skoda.petr@nemocnicenachod.cz\">skoda.petr@nemocnicenachod.cz</a></p>',25,7,'2019-10-09 11:14:57',NULL),(105,1,'Město Jaroměř vyhlašuje VŘ na pozici VEDOUCÍ ODDĚLENÍ sociálněprávní ochrany dětí','<p style=\"text-align: center;\"><strong>Oznámení o vyhlášení výběrového řízení<br />\nměsto Jaroměř vyhlašuje<br />\npodle zákona o č.312/2002 Sb., o úřednících územních samosprávných celků, v platném znění<br />\nvýběrové řízení č. 46/2019<br />\nna obsazení pracovního místa: </strong></p><h2 style=\"text-align: center;\"><br />\nVEDOUCÍ ODDĚLENÍ sociálněprávní ochrany dětí (dále OSPOD) odboru sociálních věcí a zdravotnictví (dále OSVZ),</h2><p style=\"text-align: center;\"><strong>Městského úřadu Jaroměř pro území obce s rozšířenou působností Jaroměř.</strong></p><ul><li>Místo výkonu práce: Jaroměř</li><li>Předpokládaný nástup do zaměstnání: Nástup možný ihned po ukončení výběrového řízení</li><li>Doba trvání pracovního poměru: Plný pracovní úvazek, doba určitá s šestiměsíční zkušební dobou (zástup za RD) &ndash; nejdéle do 10.11.2021</li><li>Platové zařazení: Platová třída č. 10</li></ul><p><font>Písemnou přihlášku je nutné předložit nejpozději do </font><b><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">10.01.2020 </font></font></b><font>(výhradně prostřednictvím držitele poštovní </font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">licence nebo na podatelnu M</font></font><font>Ú) na adresu: </font><b><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">Městský úřad Jaroměř, k rukám tajem</font></font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">nice Ing. Michaely </font></font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">Skovajsové, nám. Československé armády 16, 551 01 Jaroměř</font></font></b><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">. </font></font><b><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">Obálku označte &ldquo;VŘ č. </font></font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">46/2019 </font></font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">&ndash; </font></font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">OSPOD V</font></font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">edoucí odd. &ndash; neotvírat&ldquo;. </font></font></b></p><p>Více informací najdete v příloze.</p>',28,7,'2019-12-09 16:30:31',NULL),(106,1,'Oblastní nemocnice Náchod příjme lékaře/ku na dětské oddělení','<h2>Oblastní nemocnice Náchod přijme lékaře/ku na dětské oddělení po základním kmeni ve specializačním vzdělávání lékařů</h2>\n\n\n\n<h3>Požadujeme:</h3>\n\n<ul><li>odbornou způsobilost k výkonu povolání lékaře</li><li>certifikát o absolvování základního kmene</li><li>specializovaná způsobilost v příslušném oboru je výhodou</li><li>trestní bezúhonnost</li></ul>\n\n<h3>Nabízíme:</h3>\n\n<ul><li>smluvní mzdu pro lékaře se specializovanou způsobilostí až 70 000 Kč měsíčně</li><li>poskytujeme stabilizační odměnu pro lékaře s odbornou způsobilostí ve výši 25 000 Kč při úvazku 1,0 a setrvání v pracovním poměru 18 měsíců</li><li>poskytujeme stabilizační odměnu pro lékaře po základním kmeni ve výši 40 000 Kč při úvazku 1,0 a setrvání v pracovním poměru 18 měsíců</li><li>poskytujeme stabilizační odměnu pro lékaře se specializovanou způsobilostí ve výši 60 000 Kč při úvazku 1,0 a setrvání v pracovním poměru 18 měsíců</li><li>nástup možný ihned</li><li>akreditované pracoviště</li><li>pracovní poměr na dobu neurčitou</li><li>příspěvek na ubytování (pro nově přijímané zaměstnance s trvalým bydlištěm mimo Královéhradecký kraj) na 24 měsíců ve výši 3 500 Kč</li><li>příspěvek na penzijní a životní pojištění</li><li>možnost využití nemocniční knihovny</li><li>dotovaná strava v jídelně v areálu nemocnice</li><li>zaměstnanecký mobilní tarif i pro členy rodiny</li><li>úhrada členského příspěvku České lékařské komoře při úvazku 1,0</li><li>nástupní mzda lékaře s odbornou způsobilostí od 35 540 Kč (bližší informace o výši platu při osobním jednání)</li><li>nástupní mzda lékaře po základním kmeni od 42 560 Kč (bližší informace o výši platu při osobním jednání)</li></ul>V případě zájmu o bližší informace nás kontaktujte:<br />Bc. Eva Jará, +420 728 215 931, <a href=\"mailto:jara.eva@nemocnicenachod.cz\">jara.eva@nemocnicenachod.cz</a>',25,7,'2020-04-01 15:26:41','2020-12-31 23:59:59'),(107,1,'Oblastní nemocnice Náchod přijme všeobecnou/praktickou sestru do LDN v Jaroměři','<p>Oblastní nemocnice Náchod přijme</p><h2>všeobecnou/praktickou sestru do LDN v Jaroměři</h2><h3>Požadujeme:</h3><ul><li>vzdělání dle &sect; 5, &sect; 21b) zák. č. 96/2004 Sb., o nelékařských zdravotnických povoláních</li><li>trestní bezúhonnost</li></ul><h3>Nabízíme:</h3><ul><li>nástup možný ihned</li><li>vhodné i pro absolventy</li><li>nástupní mzda všeobecné sestry od 26 590 Kč</li><li>nástupní mzda praktické sestry od 23 510 Kč</li><li>zaměstnanecké benefity a čtvrtletní odměny</li><li>stabilizační odměna pro všeobecné/praktické sestry 30 000 Kč s podmínkou setrvání v pracovním poměru minimálně 18 měsíců a úvazku 1,0</li><li>pracovní poměr na dobu neurčitou</li><li>pomoc se zajištěním ubytování</li><li>turnusové služby</li><li>místo výkonu práce Jaroměř</li></ul><p><strong>V případě zájmu kontaktujte:</strong> Bc. Eva Jará, +420 728 215 931, <a href=\"mailto:jara.eva@nemocnicenachod.cz\">jara.eva@nemocnicenachod.cz</a></p>',25,7,'2020-04-27 14:11:15','2020-12-31 23:59:59'),(108,1,'Oblastní nemocnice Náchod příjme lékaře/ku na rehabilitační oddělení','<h2>Oblastní nemocnice Náchod přijme lékaře/ku na rehabilitační oddělení</h2>\n\n\n\n<h3>Požadujeme:</h3>\n\n<ul><li>odbornou způsobilost k výkonu povolání lékaře</li><li>certifikát o absolvování základního kmene</li><li>specializovaná způsobilost v příslušném oboru je výhodou</li><li>trestní bezúhonnost</li></ul>\n\n<h3>Nabízíme:</h3>\n\n<ul><li>smluvní mzdu pro lékaře se specializovanou způsobilostí až 70 000 Kč měsíčně</li><li>poskytujeme stabilizační odměnu pro lékaře s odbornou způsobilostí ve výši 25 000 Kč při úvazku 1,0 a setrvání v pracovním poměru 18 měsíců</li><li>poskytujeme stabilizační odměnu pro lékaře po základním kmeni ve výši 40 000 Kč při úvazku 1,0 a setrvání v pracovním poměru 18 měsíců</li><li>poskytujeme stabilizační odměnu pro lékaře se specializovanou způsobilostí ve výši 60 000 Kč při úvazku 1,0 a setrvání v pracovním poměru 18 měsíců</li><li>nástup možný ihned</li><li>akreditované pracoviště</li><li>pracovní poměr na dobu neurčitou</li><li>příspěvek na ubytování (pro nově přijímané zaměstnance s trvalým bydlištěm mimo Královéhradecký kraj) na 24 měsíců ve výši 3 500 Kč</li><li>příspěvek na penzijní a životní pojištění</li><li>možnost využití nemocniční knihovny</li><li>dotovaná strava v jídelně v areálu nemocnice</li><li>zaměstnanecký mobilní tarif i pro členy rodiny</li><li>úhrada členského příspěvku České lékařské komoře při úvazku 1,0</li><li>nástupní mzda lékaře s odbornou způsobilostí od 35 540 Kč (bližší informace o výši platu při osobním jednání)</li><li>nástupní mzda lékaře po základním kmeni od 42 560 Kč (bližší informace o výši platu při osobním jednání)</li></ul>V případě zájmu o bližší informace nás kontaktujte:<br />Bc. Eva Jará, +420 728 215 931, <a href=\"mailto:jara.eva@nemocnicenachod.cz\">jara.eva@nemocnicenachod.cz</a>',25,7,'2020-04-01 15:20:20','2020-12-31 23:59:59'),(109,1,'Nemocnice Náchod přijme sanitáře/ku do LDN Jaroměř','<p><h3>Oblastní nemocnice Náchod přijme sanitáře/ku do LDN Jaroměř</h3>\n</p><p>\n</p><p><strong>Požadujeme:</strong><ul><li>trestní bezúhonnost</li><li>spolehlivost</li></ul><strong>Výhodou:</strong><ul><li>vzdělání dle &sect; 42 zákona č. 96/2004 Sb., o nelékařských zdravotnických povolání</li></ul><strong>Nabízíme:</strong><ul><li>nástup možný ihned</li><li>vhodné i pro absolventy</li><li>nástupní mzda bez požadovaného vzdělání od 16 490 Kč</li><li>nástupní mzda se zákonným vzděláním od 17 740 Kč</li><li>zaměstnanecké benefity a čtvrtletní odměny</li><li>podnikové stravování</li><li>zaměstnavatel umožní absolvování sanitářského kurzu, na kterém se finančně podílí</li><li>stabilizační odměna pro sanitáře 10 000 Kč s podmínkou setrvání v pracovním poměru minimálně 18 měsíců a při úvazku 1,0</li><li>turnusové služby</li></ul><strong>Náplň práce:</strong>\n</p><p>\n</p><p>Sanitář provádí pomocné a obslužné činnosti nutné pro poskytování ošetřovatelské péče, preventivní, léčebné a diagnostické péče (např. doprovod pacientů na vyšetření, podávání stravy pacientům, asistence sestrám a lékařům, péče o lůžko a prádlo pacienta, základní ošetření pacientů, manipulace s biologickým materiálem, ...) - pozor, nejedná se o řidiče &quot;sanitního&quot; vozu!\n</p><p>\n</p><p><strong>V případě zájmu kontaktujte:</strong>\n</p><p>\n</p><p>Bc. Eva Jará, +420 728 215 931, <a href=\"mailto:jara.eva@nemocnicenachod.cz\">jara.eva@nemocnicenachod.cz</a></p>',25,7,'2020-07-30 10:23:30','2020-12-31 23:59:59'),(110,1,'Museum východních Čech v Hradci Králové vyhlašuje výběrové řízení na místo: účetní',NULL,29,7,'2020-10-14 00:00:00','2020-10-29 23:59:59'),(111,1,'Město Kostelec nad Orlicí vyhlašuje výběrové řízení na místo: referent/ka životního prostředí - myslivost, péče o les, rybářství, ochrana zvířat',NULL,30,7,'2020-10-14 00:00:00','2020-11-12 23:59:59'),(112,1,'Výběrové řízení na pozici Odborný konzultant pro energetiku',NULL,31,7,'2020-10-02 00:00:00','2020-11-02 23:59:59'),(113,1,'Město Kostelec nad Orlicí vyhlašuje výběrové řízení na místo: referent/ka přestupkového řízení na úseku dopravy',NULL,30,7,'2020-09-16 00:00:00','2020-10-22 23:59:59'),(114,1,'Město Jaroměř vyhlašuje VŘ č. 37 na pozici: referent/ka státní správy - oddělení sociálněprávní ochrany dětí (dále OSPOD)','<p><p style=\"text-align: center;\"><strong>Oznámení o vyhlášení výběrového řízení<br />město Jaroměř vyhlašuje<br />podle zákona č. 312/2002 Sb., o úřednících územních samosprávných celků a o změně některých zákonů, v platném znění</strong><p style=\"text-align: center;\"><strong>Výběrové řízení č. 37/2020</strong><h3 style=\"text-align: center;\">na obsazení pracovního místa referent/ka státní správy: oddělení sociálněprávní ochrany dětí (dále OSPOD) odboru sociálních věcí a zdravotnictví (dále OSVZ) Městského úřadu Jaroměř, pro území obce s rozšířenou působností Jaroměř.</h3>\n</p><p>\n</p><p><ul><li>Místo výkonu práce: Jaroměř</li><li>Předpokládaný nástup do zaměstnání: Nástup možný ihned po VŘ</li><li>Doba trvání pracovního poměru: Plný pracovní úvazek, doba určitá (nejdéle do 31.12.2023) s tříměsíční zkušební dobou</li><li>Platové zařazení: Platová třída č. 11 (22980 &ndash; 33790 Kč) určující pro platový stupeň je délka započitatelné praxe dle ustanovení &sect; 124 odst. 4 zákoníku práce a míry jejího zápočtu podle ustanovení &sect; 4 nařízení vlády č. 341/2017 Sb.</li></ul><font>Písemnou přihlášku je nutné předložit nejpozději do </font><b><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">19.10.2020 </font></font></b><font>(výhradně prostřednictvím držitele poštovní licence </font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">nebo na podatelnu M</font></font><font>Ú) na adresu: </font><b><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">Městský úřad Jaroměř, k rukám tajemnice Ing. Michaely Skovajsové, nám. Československé armády 16, 551 01 Jaroměř</font></font></b><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">. </font></font><b><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">Obálku označte &ldquo;Výběrové řízení č. 37</font></font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">/2020 - OSPOD </font></font><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">&ndash; neotvírat&ldquo;. </font></font></b>\n</p><p>\n</p><p><font face=\"Arial,Arial\"><font face=\"Arial,Arial\">Více informací najdete v příloze.</font></font></p>',28,7,'2020-10-02 14:00:40',NULL),(115,1,'Rada města Lázně Bělohrad vyhlašuje konkursní řízení na obsazení vedoucího pracovního místa: ředitel/ředitelka Bělohradské mateřské školy','<p>Rada města Lázně Bělohrad v souladu s ustanovením &sect; 102 odst. 2 písm. b) zákona č. 128/2000 Sb., o obcích (obecní zřízení), s ustanovením &sect; 166 odst. 2 zákona č. 561/2004 Sb., o předškolním, základním, středním, vyšším odborném a jiném vzdělávání (školský zákon) a ustanovením &sect; 3 vyhlášky č. 54/2005 Sb., o náležitostech konkursního řízení a konkursních komisích, vše v platném znění, vyhlašuje<p style=\"text-align: center;\"><strong>konkursní řízeni</strong><p style=\"text-align: center;\"><strong>NA OBSAZENÍ VEDOUCÍHO PRACOVNÍHO MÍSTA ŘEDITEL/ŘEDITELKA BĚLOHRADSKÉ MATEŘSKÉ ŠKOLY,<br />Horní Nová Ves 112, 507 81 Lázně Bělohrad, IČ: 71011544</strong>,\n</p><p>\n</p><p><strong>Předpoklady pro výkon činnosti ředitele/ředitelky:</strong><ul><li>odborná kvalifikace a praxe dle zákona č. 563/2004 Sb., o pedagogických pracovnících a o změně některých zákonů, ve znění pozdějších předpisů (dále jen &bdquo;zákon&ldquo;),</li><li>znalost problematiky řízení ve školství a školských předpisů,</li><li>způsobilost k právním úkonům,</li><li>bezúhonnost,</li><li>zdravotní způsobilost.</li></ul><strong>Uchazeči předloží písemnou přihlášku, která musí obsahovat tyto náležitosti:</strong><ul><li>přesné označení výběrového řízení,</li><li>jméno, příjmení a titul uchazeče,</li><li>datum a místo narození uchazeče,</li><li>státní příslušnost uchazeče,</li><li>místo trvalého pobytu uchazeče, příp. adresu pro doručování,</li><li>číslo občanského průkazu nebo dokladu o povolení k pobytu, jde-li o cizího státního občana,</li><li>kontaktní údaje,</li><li>datum a podpis uchazeče.</li></ul><strong>Výčet dokladů, které zájemce přiloží k přihlášce:</strong><ul><li>úředně ověřené kopie dokladů o nejvyšším dosaženém vzdělání, tj. vysokoškolský diplom včetně vysvědčení o státní závěrečné zkoušce nebo dodatku k diplomu, případně jiný doklad o úspěšném ukončení studia dokládající získání odborné kvalifikace,</li><li>prokázání znalosti českého jazyka fyzickou osobou, která získala příslušnou odbornou kvalifikaci v jiném vyučovacím jazyce než českém,</li><li>čestné prohlášení o průběhu zaměstnání s vyznačením počátku a konce pracovněprávního vztahu a pracovního zařazení v jednotlivých organizacích s přesností na dny doložené potvrzením o zaměstnání nebo potvrzením od zaměstnavatele,</li><li>strukturovaný životopis,</li><li>vlastní koncepce rozvoje školy v rozsahu maximálně 2 normostran,</li><li>výpis z evidence Rejstříku trestů (ne starší 3 měsíců),</li><li>čestné prohlášení o plné způsobilosti k právním úkonům,</li><li>lékařské potvrzení o zdravotní způsobilosti pro výkon činnosti pedagogického pracovníka (ne starší 2 měsíců),</li><li>podepsané prohlášení uchazeče v následujícím znění: Poskytnutím svých osobních údajů v rozsahu podkladů pro přihlášku do výběrového řízení dávám, ve smyslu zákona č. 110/2019 Sb., souhlas k jejich zpracování a uchování.</li></ul><strong>Platové zařazení:</strong> dle nařízení vlády č. 341/2017 Sb., o platových poměrech zaměstnanců ve veřejných službách a správě, a nařízení vlády č. 222/2010 Sb., o katalogu prací ve veřejných službách a správě, vše v platném znění, <strong>11. platová třída;</strong> odměna za plnění mimořádných pracovních úkolů\n</p><p>\n</p><p><strong>Druh pracovního poměru:</strong> na dobu neurčitou, s 6 měsíční zkušební dobou\n</p><p>\n</p><p><strong>Předpokládaný termín nástupu do zaměstnání:</strong> ihned, případně po dohodě s vybraným uchazečem\n</p><p>\n</p><p><strong>Lhůta pro podání přihlášky:</strong> <strong>do 11. listopadu 2020 do 17:00 hod.</strong> (v této lhůtě musí být přihláška doručena na podatelnu Městského úřadu Lázně Bělohrad)\n</p><p>\n</p><p><strong>Způsob doručení přihlášky</strong>: písemně prostřednictvím provozovatele poštovních služeb nebo osobním podáním na adresu zřizovatele mateřské školy - Město Lázně Bělohrad, k rukám starosty, náměstí K. V. Raise 35, 507 81 Lázně Bělohrad\n</p><p>\n</p><p><strong>Obálku označte textem: &bdquo;NEOTVÍRAT - KONKURS ředitel/ředitelka MŠ&ldquo;.</strong>\n</p><p>\n</p><p>Vyhlašovatel si vyhrazuje právo prodloužit lhůtu pro podání přihlášky nebo toto konkursní řízení zrušit kdykoli v jeho průběhu, popř. nevybrat žádného uchazeče, a to bez udání důvodu.\n</p><p>\n</p><p>Osobní doklady budou neúspěšným uchazečům vráceny ihned po ukončení konkursního řízení. Uchazeč nemá právo na úhradu nákladů, které mu v souvislosti s účastí v konkursním řízení vzniknou.\n</p><p>\n</p><p>Bližší informace o pracovním místě podá ing. Pavel Šubr, starosta, tel.: 493 792 092, 603 295 339, e-mail: subr@lazne-belohrad.cz.\n</p><p>\n</p><p>V Lázních Bělohradě dne 12. října 2020\n</p><p>\n</p><p>MĚSTO LÁZNĚ BĚLOHRAD\n</p><p>\n</p><p>Ing. Pavel Šubr starosta</p>',32,7,'2020-10-13 15:16:42','2020-11-11 23:59:59'),(116,1,'Město Kostelec nad Orlicí vyhlašuje výběrové řízení na místo: referent/ka úřadu územního plánování',NULL,30,7,'2020-10-14 00:00:00','2020-11-12 23:59:59'),(117,1,'Město Kostelec nad Orlicí vyhlašuje výběrové řízení na místo: referent/ka obecného stavebního úřadu',NULL,30,7,'2020-10-14 00:00:00','2020-11-12 23:59:59'),(118,1,'CIRI Hradec Králové obsazuje pracovní pozici: